Text:
@smyr
70kb, där har du galet fel...
Jag gjorde detta för att folk i dagens tider är rätt lata och bara vill installera och köra, utan att ladda ner en massa extra för att kunna köra så dom velat från början:)

@theone_nr
Yes thats true, but you can use it for 120 days without problems. And like it looks now, the crackers will find a solution before the 120 days have passed by!
And its just as "worthless" as all the other builds that have leaked of windows 7 last days... For me its working like a sharm, and im hoping for a activate solution soon!:)

@Outlaw
RTMen har ju en massa buggfixar och annat som RC versionerna inte har.. Och detta ÄR RTM, vet inte var du fått din information ifrån, men det är bekräftat från Microsoft att versionen jag patchat är den som kommer släppas i butik! Jag körde själv med version 7100 innan och jag märker avsevärd skillnad i t ex prestanda och stabilitet med denna RTMen:)
Ang. 30dagars skiten så är det bara en sak MS gjort, snart kommer där riktiga aktiveringsprogram och då kan du använda denna releasen precis lika mkt som om att du köpt den i Oktober..
